        name: "Bronze",
        subscriptionYearly: "$120",
        subscriptionMonthly:"$8",
        description: "Includes 10 Miles delivery for $8."
    },
    {
        id: 1,
        name: "Silver",
        subscriptionYearly: "$150",
        subscriptionMonthly:"$10",
        description: "Includes 10 Miles delivery for $5."
    },
    {
        id: 2,
